    [],nt"num_tags": 0,nt"name": "environmental-sensitivity-index-esi-atlas-west-florida-maps-and-geographic-information-systems-",nt"isopen":
    false,nt"url": null,nt"notes": "This data set comprises the Environmental
    Sensitivity Index (ESI) maps in Portable Document Format (.PDF) for the shoreline
    of West Florida (to encompass the coastal areas from the Florida/Alabama border
    to Apalachee Bay, Florida). ESI data characterize coastal environments and wildlife
    by their sensitivity to spilled oil. The ESI data include information for three
    main components: shoreline habitats; sensitive biological resources; and human-use
    resources. This Atlas was compiled from geographical and biological data with multiple
    dates, mostly from the 1990s, the intertidal habitats were mapped during aerial
    and ground surveys conducted in June, 1993, and biological and human-use resources
    data were compiled by regional biologists in 1995. The dates for the original data
    and methodology are completely documented within the included FGDC metadata file
    METADATA.PDF and document INTRO.PDF.nnA digital data re-release 1995-1997 is also
    available under NODC Accession Number 0014187.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
